import styled from "styled-components";
import "./App.css";
import { Button } from "react-bootstrap";
import { BrowserRouter, Link } from "react-router-dom";
import Ticket from "./Tickets";
import { Container, Row } from "react-bootstrap";

const Title = styled.div`
  padding-top: 20px;
  padding-bottom: 20px;
  text-align: center;
  font-size: 60px;
  color: white;
  font-family: "Amatic SC", cursive;
`;

const Completed = styled.div`
  display: grid;
  text-align: center;
  text-decoration: none;
  color: white;
`;

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Container className="container-fluid">
          <Title>Feladatok</Title>

          <Completed>
            <nav style={{}}>
              <Link to="/uncompleted">
                <Button className="Uncompleted" variant="dark">
                  Elvégzendő feladatok
                </Button>
              </Link>
            </nav>

            <Link to="/completed">
              <Button className="Completed" variant="dark">
                Teljesített feladatok
              </Button>
            </Link>

            <Link to="all">
              <Button className="All" variant="dark">
                Összes feladat
              </Button>
            </Link>

            <Link to="new">
              <Button className="Add" variant="dark">
                Feladat hozzáadása
              </Button>
            </Link>
          </Completed>
          <Ticket />
        </Container>
      </div>
    </BrowserRouter>
  );
}

export default App;
